import React from 'react';
import './styles.css'; // Подключаем CSS файл

const Header = () => {
  return (
    <div className="header-container">
      <div className="top-line"></div>
      <div className="header-content">
        <div className="button-container">
          <img src="icon.png" alt="Icon" className="button-icon" />
          <span className="button-text">Все</span>
        </div>
        <div className="nav-links">
          <a href="#link1" className="nav-link">Слово1</a>
          <a href="#link2" className="nav-link">Слово2</a>
          <a href="#link3" className="nav-link">Слово3</a>
        </div>
        <div className="cart">
          <img src="cart-icon.png" alt="Cart Icon" className="cart-icon" />
          <span className="cart-text">Корзина</span>
        </div>
      </div>
    </div>
  );
};

export default Header;
